    {
      "cell_type": "code",
      "metadata": {
        "id": "iv8W5Jwh8fSI"
      },
      "source": [
        "#Build the model\n",
        "model=Sequential()\n",
        "model.add(Dense(256, input_dim=len(X.columns), kernel_initializer=k.initializers.random_normal(seed=13), activation='relu'))\n",
        "model.add(Dense(1, activation='hard_sigmoid'))"
      ],
